	private function init_password()
	{
		$this->db->connect();
		$this->db->query("SELECT * FROM $this->tb_user");
		$res = $this->db->get_all_rows();
		
		if (!empty($res))
		{
			foreach ($res as $value)
			{
				$sql_id = (int)$value['id'];
				$sql_password = Security::sql_var(Security::md5_multi($value['jobnum'], Config::$key));
				$this->db->query("UPDATE $this->tb_user SET password=$sql_password WHERE id=$sql_id");
			}
		}
	}
	
	public function select_af()
	{
		$this->db->connect();
		$this->db->query("SELECT jobnum FROM $this->tb_user WHERE dept='移动互联部'");
		$res = $this->db->get_all_rows();
		
		if (!empty($res))
		{
			echo count($res) . '<br />';
			foreach ($res as $value)
			{
				$new_name = '8' . substr($value['jobnum'], 1, 5);
				$password = Security::md5_multi($new_name, Config::$key);
				echo '$this->db->query("UPDATE $this->tb_user SET jobnum=\'' . $new_name . '\', password=\'' . $password . '\' WHERE jobnum=\'' . $value['jobnum'] . '\'");<br />';
			}
		}
	}
	
